const Contact = ()=>{
  return(
    <>
    <h2 className="contact-title">Contact</h2>
      <form className='form-contact'>
        <div>
          <label htmlFor="nickName">NickName: </label>
          <input type="text" placeholder='Example stom83' id='nickName' name='nickName'/>
        </div>
      </form>
    </>
  );
};
export default Contact;
